settings\u0004Note: To disable a context:
注: コンテキスト メニュー項目を無効にするには、
「disabled」キーをユーザー設定にコピーして追加します。
次の例では、ファイルのダウンロード アイテムを無効にします。:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
