settings\u0004Note: To disable a menu or:
注: メニューまたはメニュー項目を無効にするには、
「disabled」キーをユーザー設定にコピーして追加します。
次の例は「カーネルを再起動して選択したセルまで実行する」アイテムとn
「タブ」メニューを無効にします。:
{
  "menus": [
    {
      "id": "jp-mainmenu-tabs",
      "disabled": true
    },
    {
      "id": "jp-mainmenu-kernel",
      "items": [
        {
          "command": "notebook:restart-and-run-to-selected",
          "disabled": true
        }
      ]
    }
  ]
}

