アプリケーションレイアウトでデフォルトのウィジェット位置を上書きします。
例: 複数ドキュメントモードで右サイドバーにターミナルを配置し、シングルドキュメントモードでは下部に配置する場合、
{
"single": { "Terminal": { "area": "down" } },
"multiple": { "Terminal": { "area": "right" } }
}。
